import React from 'react';
import Image from 'react-image-resizer';
import disneylandcur from './disneylandcur.jpg'; // Tell Webpack this JS file uses this image

function DisneylandCur() {

    return (
      <div>
          <Image
          img src={disneylandcur} alt="disneylandcur"
          //src="./logo.png"
          height={350}
          width={700}
          style={{alignSelf:'center'}}
        />
      </div>
    );

}

export default DisneylandCur;
